const Character = (props) => {
  return (
    <>
      <img
        className=""
        src="{props.results.origin.url}"
        alt={"photo" + props.results.name}
      />
      <h4>{props.result.name}</h4>
      <h4>{props.result.species}</h4>
    </>
  );
};

export default Character;
